import React,{ useState} from "react";

const UploadForm =() =>{
    const [file, setFile] = useState(null);
    return (
      <div>
        <form>
          <label htmlFor="file">파일</label>
          <input 
            id="file" 
            type="file" 
            onChange={(event) => {
                const docfile = event.target.files[0];
                setFile(docfile);}} 
          />
          <button type="submit" />
        </form>
      </div>
    );
};
export default UploadForm;
